  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset includes case counts of myocardial
  infarction hospitalizations including cases of cardiac failure, myocardial failure,
  coronary artery disease, and acute coronary syndrome (ACS).  This dataset is intended
  to provide data consistent with the guidance for creating myocardial infarction
  hospitalization Nationally Consistent Data Measures (NCDMs).  The data contained
  in this dataset is collected by the Iowa Hospital Association on behalf of the Iowa
  Department of Public Health in accordance with Iowa Code section 135.166. This dataset
  contains confidential information. Small numbers suppression has been applied to
  data available to the public.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
